pragma solidity ^0.8.13;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/access/AccessControlEnumerable.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Pausable.sol";

//import "./ERC721/ERC721.sol";
//import "./ERC721/ERC721Enumerable.sol";

contract Gallery is ERC721, ERC721Enumerable, ERC721Pausable, AccessControlEnumerable {
    event PhotoUploaded (uint indexed tokenId, bytes photo, string title, string location, string description, uint256 timestamp);

    mapping(uint256 => PhotoData) private _photoList;

    struct PhotoData {
        uint256 tokenId;
        address[] ownerHistory;
        bytes photo;
        string title;
        string location;
        string description;
        uint256 timestamp;
    }

    string private _baseUri;

    constructor(string memory tokenName, string memory symbol, string memory baseUri) ERC721(tokenName, symbol) {
        _baseUri = baseUri;
//        setBaseURI(baseURI)
//        _setBaseUri("ipfs://");
    }

    function tokenURI(uint256 tokenId, string memory metadataURI) public view returns (string memory) {
        require(_exists(tokenId), "DeadWalkerWeapon: URI query for nonexistent token");

        string memory baseURI = _baseURI();
        return bytes(baseURI).length > 0 ? string(abi.encodePacked(baseURI, metadataURI, '.json')) : "";
    }

//    function uploadPhoto(bytes memory photo, string memory title, string memory location, string memory description) public {
    function uploadPhoto(address owner, string memory metadataURI) public returns (uint256) {
        uint256 tokenId = totalSupply() + 1;

        _mint(msg.sender, tokenId);
        tokenURI(tokenId, metadataURI);
//        _setTokenURI(tokenId, metadataURI);
//        address[] memory ownerHistory;
//
//        PhotoData memory newPhotoData = PhotoData({
//        tokenId: tokenId,
//        ownerHistory: ownerHistory,
//        photo: photo,
//        title: title,
//        location: location,
//        description: description,
//        timestamp : now
//        });
//
//        _photoList[tokenId] = newPhotoData;
//        _photoList[tokenId].ownerHistory.push(msg.sender);
//
//        emit PhotoUploaded(tokenId, photo, title, location, description, now);

        return tokenId;
    }

//    function transferOwnership(uint256 tokenId, address to) public returns(uint, address, address, address) {
//        safeTransferFrom(msg.sender, to, tokenId);
//        uint ownerHistoryLength = _photoList[tokenId].ownerHistory.length;
//        return (
//        _photoList[tokenId].tokenId,
//        _photoList[tokenId].ownerHistory[0],
//        _photoList[tokenId].ownerHistory[ownerHistoryLength-2],
//        _photoList[tokenId].ownerHistory[ownerHistoryLength-1]);
//    }
//
//    function transferFrom(address from, address to, uint256 tokenId) public {
//        super.transferFrom(from, to, tokenId);
//        _photoList[tokenId].ownerHistory.push(to);
//    }
//
//    function getTotalPhotoCount () public view returns (uint) {
//        return totalSupply();
//    }
//
//    function getPhoto(uint tokenId) public view returns(uint256, address[] memory, bytes memory, string memory, string memory, string memory, uint256) {
//        require(_photoList[tokenId].tokenId != 0, "Photo does not exist");
//        return (
//            _photoList[tokenId].tokenId,
//            _photoList[tokenId].ownerHistory,
//            _photoList[tokenId].photo,
//            _photoList[tokenId].title,
//            _photoList[tokenId].location,
//            _photoList[tokenId].description,
//            _photoList[tokenId].timestamp);
//    }

    function _baseURI() internal view override returns (string memory) {
        return _baseUri;
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 tokenId
    ) internal override(ERC721, ERC721Enumerable, ERC721Pausable) {
        super._beforeTokenTransfer(from, to, tokenId);
    }

    function supportsInterface(bytes4 interfaceId)
    public
    view
    override(AccessControlEnumerable, ERC721, ERC721Enumerable)
    returns (bool)
    {
        return super.supportsInterface(interfaceId);
    }
}
